import React from 'react';

const Navbar = () => {
    navlist={Home, About, Portfolio, Contact};
  return (
    <>
    <nav className='navbar'>
        <div className='nav-logo'>

        </div>
        <div className='btn-grp'>
            <button className='btn-nav' onClick={()=>nav-list.Map()}></button>
        </div>
    </nav>
    </>
  )
}

export default Navbar
